(144, 59, 528, 11, 1, 3, 40, 1, NULL, NULL, '2023-04-12', '../files/528_1682678853.pdf', '-', 1, 0, 0, NULL, 'Л.Н. Гумилев атындағы Еуразия ұлттық университетінің  \"Түркітану\" бағыты бойынша Студенттің Ғылыми Зерттеу жұмысы бойынша конкурстық комиссия № 9 ХАТТАМА Астана қаласы. 27 сәуір 2023 ж.\r\nІІ орын: Қойшыбай Арайлым Берікқызы «Kazak Gelenekleri ve Destanları Üzerine Bir Çalışma». Қожа Ахмет Ясауи атындағы Халықаралық қазақ- түрік университетінің \"Шетел филологиясы: түрік тілі\" мамандығы 2-курс студенті\r\n    Ғылыми жетекшісі: доцент м.а. Е.Омирбаев \r\nСертификат келесі жылы Министрлік тарапынан беріл', 2, 0, 0, '28/04/2023 16:40:20', 0, NULL, 0, 0),
(145, 59, 528, 11, 1, 3, 40, 1, NULL, NULL, '2023-04-12', '../files/528_1682678917.pdf', '-', 1, 0, 0, NULL, 'Л.Н. Гумилев атындағы Еуразия ұлттық университетінің  \"Түркітану\" бағыты бойынша Студенттің Ғылыми Зерттеу жұмысы бойынша конкурстық комиссия № 9 ХАТТАМА Астана қаласы. 27 сәуір 2023 ж.\r\nІІІ орын: Жетпісбаева Аида «Kazak veTürklerde İsim Verme Gelenekleri». Қожа Ахмет Ясауи атындағы Халықаралық қазақ- түрік университетінің «Түркітану» мамандығы 1-курс студенті.\r\n     Ғылыми жетекшісі –ф.ғ.к.доцент м.а. Е.Омирбаев\r\nСертификат келесі жылы Министрлік тарапынан беріледі.\r\nХаттама қосымша ретінде тір', 2, 0, 0, '28/04/2023 16:47:37', 0, NULL, 0, 0),
