(276, 59, 105, 11, 1, 6, 9, 1, NULL, NULL, '2023-05-05', '../files/105_1683291746.pdf', '-', 1, 0, 0, NULL, '2019-2020 оқу жылы ЖББҰ арасында болған үздік студенттердің ғылыми-зерттеу жұмыстарының байқауында (диплом болған жағдайда) жүлделі орын алған 4-курс студенті Жахия Сандуғаш ІІ дәрежелі дипломмен марапатталған. Алайда, дипломның уақытында берілмеуіне байланысты осы жылғы рейтинге салынды. Негізі І.Жансүгіров атындағы Жетісу университетінің ғылым жөніндегі проректоры А.С.Бахтаулованың университет ректоры Ж.Темирбековаға жазған 15.02.223 ж. №309 санды хаты. Аталған хат қоса тілкелді.', 2, 0, 0, '05/05/2023 19:00:50', 0, NULL, 0, 1),
