(29, 67, 2981, 11, 1, 3, 40, 1, NULL, NULL, '2021-08-31', '../files/2981_1650739774.jpg', '-', 1, 0, 0, NULL, '24-31 тамыз 2021ж күндері аралығында Түркістан қаласында Қожа Ахмет Ясауи атындағы ХҚТУ мен ТР Юнус Эмре институты тарапынан \"Eğiticilerin Eğitimi\" атты 72 сағаттық біліктілік арттыру семинары ұйымдастырылды. Семинар барысында оқытушылардың қатысуымен шетелдіктерге түрік тілін үйрету бағыты бойынша тақырып бойынша практикалық сабақтар өтіліп, тәжірибе алмасу жұмыстары орындалды. Семинар соңында іс-шараға белсенді қатысқан оқытушыларға тағылымдамадан өткенін растайтын сертификат берілді. ', 2, 0, 0, '24/04/2022 00:29:42'),
